import React from 'react';
import './mystyle.css'; // Create a CSS file for styling

const A = () => {
  return (
    <div className="container">
      <div className="header">
        <div className="header-left">Cryptoart</div>
        <div className="header-right">
          <img src="path/to/your/photo.jpg" alt="Cryptoart" />
        </div>
      </div>
      <div className="content">
        <div className="text">
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam eget lectus euismod, aliquam orci non, efficitur odio. Quisque id rhoncus lacus, eget
            tincidunt dui. Vestibulum id bibendum nulla. Nulla facilisi. Proin nec sapien ac purus semper cursus.
          </p>
        </div>
        <div className="image">
          <img src="path/to/your/cryptoart.jpg" alt="Cryptoart" />
        </div>
      </div>
    </div>
  );
};

export default CryptoArtComponent;
